import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import { BrowserRouter, Route, Switch } from "react-router-dom";
//issue? nt sure man,
import BarChart from "./BarChart";

function App() {
  return (
    <BrowserRouter>
      <div>
        <Switch>
          {/* home page */}
          <Route path='/' component={BarChart} exact />
        </Switch>
      </div>
    </BrowserRouter>
  );
}
export default App;
